import React from 'react';

const SaveWall = ({ onSave }) => {
  return (
    <button
      style={{
        backgroundColor: '#4CAF50',
        color: 'white',
        padding: '10px 20px',
        border: 'none',
        borderRadius: '5px',
        fontSize: '16px',
        cursor: 'pointer',
        marginTop: '10px',
        fontWeight: 'bold',
      }}
      onClick={onSave}
    >
      Save Wall
    </button>
  );
};

export default SaveWall;
